// Python
def get_items(self):
    viewable_items = []
    item_values = self.items.values()
    if not isinstance(self.authorization_strategy, AuthorizationStrategy.Unsecured) and not isinstance(self.authorization_strategy, FullControlOnceLoggedInAuthorizationStrategy):
        for item in item_values:
            if not item.has_permission(Item.READ):
                continue
            viewable_items.append(item)
        return viewable_items
    return list(item_values)

